   // Extract the message value
   let message_value = message.value;

  // TEST params for the email
  console.log("Email: " , email_value);
  console.log("Message: " , message_value)




}
function Contact() {
    return (
        <>
        <div class="input-container">
            <label htmlFor="Email">Email:</label>
